description:
#### **Traitement Judilibre**
**Judilibre** est le traitement mis en œuvre par la Cour de cassation pour mettre à la disposition du public, gratuitement, une base de données ouverte alimentée par les décisions rendues publiquement par la Cour de cassation éventuellement enrichies et pseudonymisées. Au fur et à mesure du calendrier établi par l’arrêté du 28 avril 2021, la base de données sera enrichie de décisions rendues par d’autres juridictions de l’ordre judiciaire. La prochaine échéance est le 30 avril 2022 avec la diffusion des décisions civiles, sociales et commerciales des cours d’appel.
[Tout savoir sur l'open data des décisions de justice](https://www.courdecassation.fr/la-cour-de-cassation/demain/lopen-data-des-decisions-judiciaires)
[Le document source du présent article est suceptible d'être plus actualisé](https://www.courdecassation.fr/acces-rapide-judilibre/open-data-et-api)
Au 30 septembre 2021, sont disponibles dans la base Judilibre environ 480 000 décisions rendues publiquement par la Cour de cassation, principalement depuis 1947. Quelques décisions rendues antérieurement peuvent aussi y être trouvées. Les décisions sont versées dans la base Judilibre le jour même de leur prononcé pour les arrêts publiés au Bulletin (arrêt B) et dans un délai maximal d’une semaine après leur prononcé pour les autres arrêts de la Cour de cassation.
De nombreux enrichissements des décisions peuvent, en outre, être disponibles dans la base de données: le titrage et les sommaires des arrêts publiés, certains  travaux préparatoires (rapports et avis des avocats généraux), des renvois documentaires, les moyens annexés des décisions de rejet non spécialement motivé, des rapprochements de jurisprudence, des références aux textes appliqués, des références à la décision qui a fait l’objet du pourvoi devant la Cour de cassation ou encore , le cas échéant, la décision attaquée elle-même si cette décision a été rendue publiquement et a été pseudonymisée.
Le calendrier de publication est le suivant:
- 30 septembre 2021 - décisions rendues par la Cour de cassation 
- 30 avril 2022 : décisions civiles, sociales et commerciales des cours d’appel
- 30 juin 2023 : décisions des conseils de prudhommes
- 31 décembre 2024 : décisions des tribunaux de commerce
- 30 septembre 2025 : décisions des tribunaux judiciaires en matière civile
#### **Accéder aux décisions**
Les décisions peuvent être consultées et/ou téléchargées à partir :
- Du moteur de recherche « Judilibre »
- De l’API (Application Programming Interface ou interface de programmation applicative) Judilibre, par l’intermédiaire du portail [Piste](https://piste.gouv.fr) accessible gratuitement, après inscription.
L'API est également référencée sur [api.gouv.fr](https://api.gouv.fr/les-api/api-judilibre).
#### **Les données**
Le format ouvert (JSON) utilisé par l’API est détaillé dans la documentation technique publiée sur le [portail PISTE](https://piste.gouv.fr/index.php?option=com_apiportal&view=apitester&usage=api&apitab=tests&apiName=JUDILIBRE&apiId=2cd0b969-d459-4f27-83f4-f3e9a3fd5dae&managerId=2&type=rest&apiVersion=1.0.0&Itemid=265&swaggerVersion=2.0&lang=fr), [api.gouv.fr](https://api.gouv.fr/documentation/api-judilibre), et sur le [dépôt Github du projet](https://github.com/Cour-de-cassation/judilibre-search) (au format Swagger ou OpenAPI 3.0.2).
Les principales propriétés d’une décision sont les suivantes (la plupart pouvant servir de filtre ou de cible pour la recherche) :
- jurisdiction : L'identifiant de sa juridiction ;
- chamber : L'identifiant de sa chambre ;
- formation : Sa formation ;
- number : Son numéro de pourvoi ;
- ecli : Son ECLI (« European Case Law Identifier ») ;
- publication : Son niveau de publication ;
- solution : Sa solution ;
- decision_date : Sa date ;
- text : Son texte intégral (sans mise en forme) ;
- zones : Les délimitations des principales zones d'intérêt de son texte intégral (introduction, exposé du litige, moyens, motivations, dispositif et moyens annexés) ;
- themes : Ses éléments de titrage ;
- summary : Son sommaire ;
- files : Ses documents associés (communiqué, note explicative, traduction, rapport, avis de l'avocat général, etc.) ;
- visa : Les textes appliqués ;
- rapprochements : Les rapprochements de jurisprudence.
#### **Licence et conditions générales d'utilisation**
- [Licence ouverte de réutilisation d'information publiques v2.0](https://www.etalab.gouv.fr/wp-content/uploads/2017/04/ETALAB-Licence-Ouverte-v2.0.pdf)
- [Les conditions générales d'utilisation Judilibre](https://www.courdecassation.fr/conditions-generales-dutilisation-pour-la-reutilisation-des-donnees-issues-des-decisions-de-justice)
- [Les conditions générales d'utilisation de Piste](https://developer.aife.economie.gouv.fr/images/com_apiportal/CGU/cgu_portal_FR.pdf)

Les Fonds de participation des habitants (FPH) sont issus de la volonté d’associations et d’habitants du Nord – Pas de Calais de recourir à des modalités de financement souples et rapides pour permettre la réalisation de micro-projets dans les quartiers prioritaires de la Politique de la ville.
Institutionnalisés avec le Contrat de plan État – Région 1989-1994, les FPH ont été intégrés aux politiques contractuelles régionales cofinancées par la Ville de Roubaix sur son territoire depuis 1994 avec pour objectifs de :
  * favoriser les prises d’initiatives de groupes d’habitants, constitués ou non en association ;
  * renforcer les échanges entre habitants ;
  * promouvoir les capacités individuelles et collectives des habitants à s’organiser, monter des projets et les argumenter ;
  * favoriser la réalisation de projets ponctuels d’habitants ayant un impact sur le quartier, et non finançables par les procédures existant par ailleurs ;
  * développer l’animation et la solidarité ;
  * améliorer le cadre de vie ;
  * permettre une meilleure appropriation par la population des valeurs citoyennes.
La distinction entre les FPH réservés aux associations et ceux réservés aux habitants a été abandonnée à l’échelle régionale dans le cadres des Contrats urbains de cohésion sociale 2007-2014. Fusionnés, les FPH sont devenus le FPH.
Localement recentré sur cinq Comités d’attribution composés d’habitants bénévoles fonctionnant chacun à l’échelle des mairies de quartiers, le dispositif renouvelé a été expérimenté fin 2009 puis confirmé à partir de 2010 avec succès.
Animé auprès de la population par la Ville de Roubaix, le FPH a été régi par une association dédiée, responsable devant les financeurs institutionnels, les bénévoles et les habitants de sa gestion financière et administrative.
Reconduit dans le cadre des Contrats de ville 2015-2022, le FPH a cédé la place au [Projet d’initiative citoyenne (PIC)](https://opendata.roubaix.fr/explore/dataset/pic_contrat_ville/information/) en 2017.

## Le jeu de données
Le jeu de données présente les quantités mises sur le marché pour les filières :
* Déchets d’éléments d’ameublement (à partir de 2017) ;
* Déchets des équipements électriques et électroniques (à partir de 2018) ;
* Piles et accumulateurs (à partir de 2018) ;
* Pneumatiques usagés (à partir de 2018) ;
* Déchets issus de bateaux de plaisance ou de sport (à partir de 2019).
<p></p>
**Date de mise à jour des données : août 2021**
## Règles d’actualisation des données
Les données sont actualisées tous les ans par les déclarations des éco-organismes et des producteurs en système individuel. 
Lors de la période de déclaration d’une année N portant sur les données de l’année N-1, des modifications ont pu être apportées sur les déclarations des données des années antérieures (N-2 et N-3).
## Généralités sur les filières REP
L’État a confié à l’ADEME la mise en place et la gestion des registres de déclarations annuelles obligatoires des metteurs sur le marché relevant des [filières REP](https://www.ademe.fr/expertises/dechets/elements-contexte/filieres-a-responsabilite-elargie-producteurs-rep) suivantes : 
* Déchets des équipements électriques et électroniques (DEEE) ; 
* Piles et accumulateurs (PA) ;
* Pneumatiques usagés (PU) ;
* Véhicules automobiles hors d’usage (VHU) ;
* Déchets d’éléments d’ameublement (DEA) ;
* Papiers graphiques (PAP) ;
* Emballages ménagers (EMB) ;
* Déchets issus de bateaux de plaisance ou de sport (DBPS).
<p></p>
Cette liste va s’enrichir au fur et à mesure de l’entrée en vigueur de la loi AGEC avec :
* Au 01/01/2022, les filières : Produits du tabac, Lubrifiants (HU), Articles de bricolage et de jardin (ABJ), Articles de sport et loisirs (ASL), Jouets, Produits et matériaux du secteur de la construction du bâtiment (PMCB),
* Au 01/01/2023, la filière Emballages issus de la restauration,
* Au 01/01/2024, les filières Gommes à mâcher et Textiles sanitaires à usage unique,
* Au 01/01/2025, la filière Engins de pêche.
<p></p>
Ces registres sont gérés dans l’application SYDEREP, permettant aux éco-organismes ou aux producteurs en système individuel, le renseignement direct de leurs données. Ces registres ayant pour objet la mesure de la performance globale au niveau national de chacune des filières REP, l’ADEME établit et publie annuellement, via sa [Librairie](https://librairie.ademe.fr/) un état des lieux des filières avec un certain nombre d’indicateurs agglomérés, complétés d'éléments d'analyses qualitatives provenant des acteurs de chaque filière. 
<p></p>
Les données issues de ces registres sont aujourd’hui disponibles sur https://data.ademe.fr : 
* La liste des producteurs inscrits sur SYDEREP, pour l’ensemble des filières ; 
* Les quantités mises sur le marché pour les filières DEA, DEEE, PA, PU et DBPS ; 
* Les tonnages collectés pour les filières DEA, DEEE, PA, PU et VHU ; 
Ainsi que certains indicateurs, au fur et à mesure de leur mise à disposition.

Bruitparif est un centre d’évaluation technique de l’environnement sonore qui remplit trois missions d'intérêt général :Observation du bruit en Île-de-France
A l'aide de son réseau de mesure du bruit, des cartographies qu'il élabore et des études qu'il produit, Bruitparif permet de disposer d’informations fiables, indépendantes et transparentes sur les niveaux sonores en Île-de-France et répond ainsi à la demande des Franciliens et des associations de défense de l’environnement.
Bruitparif s'intéresse aux types de bruit suivants :
  * bruit lié à la circulation routière ;
  * bruit lié au trafic aérien ;
  * bruit lié au trafic ferroviaire ;
  * bruit lié aux activités commerciales, industrielles ou de loisirs ;
  * bruit lié à la vie locale.
Accompagnement des acteurs franciliens à la prise en compte du bruit dans les politiques publiques
Bruitparif permet également de fédérer les acteurs afin de permettre la définition, l’amélioration et l’évaluation des politiques publiques de prévention et de lutte en matière de nuisances sonores sur le territoire.
Il accompagne les acteurs dans la mise en oeuvre de la Directive européenne 2002/49/CE (gestion du bruit dans l'environnement), valorise et diffuse les bonnes pratiques en matière de prévention et de gestion du bruit dans l'environnement.
Information et sensibilisation
Bruitparif joue enfin un rôle d'information par la diffusion des données, des études et des informations sur l'environnement sonore en Île-de-France et la participation à des opérations de sensibilisation du grand public.

Selon l’article 6 de la loi 9 décembre 2016 relative à la transparence, à la lutte contre la corruption et à la modernisation de la vie économique, l’alerte éthique est une procédure qui permet à une personne physique, agent public ou collaborateur extérieur et occasionnel de la collectivité, de signaler ou de révéler de manière désintéressée et de bonne foi des faits concernant :  
\- un crime ou un délit ;  
\- une violation grave et manifeste d’un engagement international ratifié ou approuvé par la France ;  
\- une violation grave et manifeste d’un acte unilatéral d’une organisation internationale pris sur le fondement d’un engagement international régulièrement ratifié ou approuvé par la France ;  
\- une violation grave et manifeste de la loi ou d’un règlement ;  
\- une menace ou un préjudice grave pour l’intérêt général
